import React from 'react'
import {Nav, NavbarContainer, NavLogo} from './NavbarElements'


const Navbar = () => {
  return (
    <>
        <Nav>
            <NavbarContainer>
                <NavLogo to="/">Ruspina</NavLogo>
            </NavbarContainer>
        </Nav>
    </>
  )
}

export default Navbar;
